I have a list of words in an array. I want to sort them in case-sensative order. For example, if I have the following array:
var arr = ['apple', 'Apple', 'Banana', 'banana'];
I want to sort it like this:
['Apple', 'apple', 'Banana', 'banana']
I tried using the following code:
arr.sort(function(a, b) {
    return a.toLowerCase() > b.toLowerCase();
But it sorts it like this:
['Apple', 'apple', 'banana', 'Banana']
How can I sort it in case-sensative order?
You can use localeCompare :
arr.sort((a, b) => a.localeCompare(b));
Or, if you want to use a custom sort function:
arr.sort((a, b) => a.localeCompare(b, undefined, {sensitivity: 'base'}));
